import React, {useState, useEffect} from "react";
import Todo from "./Todo.jsx";
import axios from "axios";

export default function TodoList( {user, isMobile}){
    const [todoList, setTodoList] = useState([]);
    const [isEmpty, setEmpty] = useState(false);

    useEffect(() => {
       axios.get('http://localhost:5000/todos/611e92451c49a231f80a5709') 
            .then(response => {
                setTodoList(response.data.reverse());
                
                
                {/* const temp = todoList.filter(todo => todo.todoCompleted === true); */}
                {/* setTodoList(temp); */}
                
            });
            if(todoList.length === 0){
                setEmpty(true);
            }

    }, []);    




    return(
        <div>
            {!isEmpty && 
            <section id="todolist">
                {todoList.map(todo => (
                    
                    <Todo key={todo._id} todoId={todo._id} updatedAt={todo.updatedAt} todoText={todo.todoText} isMobile={isMobile} todoCompleted={todo.todoCompleted}/>
                ))}
            </section>
            }
            {isEmpty && 

                <section id="emptyTodoList">
                    <div className="flex justify-center bg-red-800 h-1/2 ">
                        <h1>Wow, such empty</h1>
                    </div>
                </section>
            }
        </div>
    );

}
